import{_ as e,o as a,c as t,e as r}from"./app.76739b9c.js";const s={},n=r('<h1 id="script-s-constraint" tabindex="-1"><a class="header-anchor" href="#script-s-constraint" aria-hidden="true">#</a> Script&#39;s Constraint</h1><p>This is the list of all constrains that exists in the script. Make sure that you did not do things as following, as the data retrieval or update can create a bigger issue.</p><h2 id="system-required-column-header-or-whole-column" tabindex="-1"><a class="header-anchor" href="#system-required-column-header-or-whole-column" aria-hidden="true">#</a> System-required column header or whole column</h2><p>As it is required by the script to fetch and release data correctly. Do not delete system-required column header or whole column while the script is running.</p><h2 id="system-required-sheet-deletions-name-edit" tabindex="-1"><a class="header-anchor" href="#system-required-sheet-deletions-name-edit" aria-hidden="true">#</a> System-required sheet deletions / name edit</h2><p>You should not delete/rename the &#39;Response&#39; and &#39;Inbound&#39; sheet while the script is running.</p><h2 id="inserting-moving-data-between-rows" tabindex="-1"><a class="header-anchor" href="#inserting-moving-data-between-rows" aria-hidden="true">#</a> Inserting / Moving data between rows</h2><p>You should not insert or move any row between the response record. It will cause the response ID to recalculate and may looking for inbound that have the same IDs.</p><p>Any same ID in the header does not make error, but just correction of the data is wrong.</p><p>If the response ID is changed, no worries. But to the response in the inbound, that must be changed to &#39;respond to the new response ID&#39;.</p><h2 id="change-data-type-in-system-required-column" tabindex="-1"><a class="header-anchor" href="#change-data-type-in-system-required-column" aria-hidden="true">#</a> Change data type in system-required column</h2><p>Changing the data type via Sheet might cause the script to retrieve unreadable data, causing script to make errors.</p><h2 id="footer-row" tabindex="-1"><a class="header-anchor" href="#footer-row" aria-hidden="true">#</a> Footer Row</h2><p>There is no support for footer row. Footer row will be treated as a Response.</p><h2 id="changing-status-manually" tabindex="-1"><a class="header-anchor" href="#changing-status-manually" aria-hidden="true">#</a> Changing status manually</h2><p>If you have changed the status manually, please make sure it is script-readable. Else the script will incorrectly determines the Response actions.</p><h2 id="have-multiple-system-required-header-name" tabindex="-1"><a class="header-anchor" href="#have-multiple-system-required-header-name" aria-hidden="true">#</a> Have multiple system-required header name</h2><p>When there is a multiple system-required header name (e.g. Response ID), script will takes the leftmost data as system-required column. (i.e. When you have Response ID at column A and D, script will takes column A as system-required column for Response ID)</p><p>For best practice, you should not have any duplicate header name. This can cause data to be fetched from a wrong column or store data in an incorrect column.</p>',19),i=[n];function o(h,d){return a(),t("div",null,i)}var l=e(s,[["render",o],["__file","index.html.vue"]]);export{l as default};
